-- #3 Product

DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `ProductID` INT NOT NULL AUTO_INCREMENT,
  `ProductName` VARCHAR(100) DEFAULT NULL,
  `Description` TEXT,
  `Price` DECIMAL(10,2) DEFAULT NULL,
