-- #7 Payment

DROP TABLE IF EXISTS `payment`;
CREATE TABLE `payment` (
  `PaymentID` BIGINT NOT NULL AUTO_INCREMENT,
  `InvoiceID` INT DEFAULT NULL,
  `PaymentDate` TIMESTAMP NULL DEFAULT NULL,
  `Amount` DECIMAL(10,2) DEFAULT NULL,
  `PaymentMethod` ENUM('Cash','Credit Card','Debit Card','Bank Transfer') DEFAULT NULL,
  `UserID` BIGINT DEFAULT NULL,
  PRIMARY KEY (`PaymentID`),
  KEY `InvoiceID` (`InvoiceID`),
  KEY `UserID` (`UserID`),
  CONSTRAINT `payment_ibfk_1` FOREIGN KEY (`InvoiceID`) REFERENCES `invoice` (`InvoiceID`),
  CONSTRAINT `payment_ibfk_2` FOREIGN KEY (`UserID`) REFERENCES `user` (`id`)
) ENGINE=INNODB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

